":"","headliners":[{"id":1737189,"name":"NOBUNNY","startTime":null,"eventDescription":"Always clad in a fuzzy (and mildly psychotic-looking) rabbit mask and often wearing little else, NOBUNNY is a one-man pop-punk onslaught whose simple, infectiously hooky tunes and lusty outlook have earned comparisons to the Ramones,Hasil Adkins, and the Cramps, and whose untamed (and sometimes bottomless) stage shows have led some to call him a cuddly version of G.G. Allin. NOBUNNY is the alter ego of Justin Champlin, who was born and raised in Tucson, Arizona, and relocated to San Francisco, California.Champlin first made a name for himself as the drummer with garage punks the Okmoniks and later co-founded the Sneaky Pinks, a two-man punk-pop party machine. 

With NOBUNNY, Champlin streamlined the concept of the Sneaky Pinks by paring the consistent lineup down to just one person (or one mutant; as part of the NOBUNNY myth, Champlin claims to be the product of a liaison between a woman and a jackalope). Sometimes working solo and sometimes backed by a constantly shifting group of musicians, Champlinhas been performing as NOBUNNY since 2001, though it wasn’t until 2008 that he made his recorded debut with the album Love Visions. Primarily recorded at home with Champlin handling most of the instruments, Love Visions was released by the tiny Bubbledum Records label; it earned enthusiastic reviews in the underground music press and was reissued in 2009 by the somewhat larger 1-2-3-4 Go! Records. In 2009, NOBUNNY put out a single through Horizontal Action Records, “Give It to Me” b/w “Motorhead with Me,” and a cassette-only album, Raw Romance, on Burger Records. 

NOBUNNY also kept up a busy touring schedule in the wake of Love Visions, telling reporter Eric Allen, “The road is good, because at least I know where my next meal is coming from. I find life much easier on tour. It’s not being on tour that is hard for me.” In September of 2010, NOBUNNY’s second full-length album, First Blood, was released by Goner. After a relatively quiet 2011 with no recordings released, NOBUNNY returned in 2012 with a single for Suicide Squeeze and an EP for Goner. He stuck with Goner for his third full-length blast of garage punk, 2013’s Secret Songs.","isMobileFriendly":"false","image":{"jumbo":{"path":"http://cdn.ticketfly.com/i/00/02/32/28/43-atjmbo.jpg","width":960,"height":638},"jumbo1":{"path":"http://cdn.ticketfly.com/i/00/02/32/28/43-atjmbo1.jpg","width":960,"height":540},"large":{"path":"http://cdn.ticketfly.com/i/00/02/32/28/43-atlg.jpg","width":300,"height":199},"large1":{"path":"http://cdn.ticketfly.com/i/00/02/32/28/43-atlg1.jpg","width":300,"height":199},"medium":{"path":"http://cdn.ticketfly.com/i/00/02/32/28/43-atmd.jpg","width":200,"height":133},"medium1":{"path":"http://cdn.ticketfly.com/i/00/02/32/28/43-atmd1.jpg","width":200,"height":133},"original":{"path":"http://cdn.ticketfly.com/i/00/02/32/28/43-og.jpg","width":2048,"height":1360},"small":{"path":"http://cdn.ticketfly.com/i/00/02/32/28/43-atsm.jpg","width":100,"height":66},"small1":{"path":"http://cdn.ticketfly.com/i/00/02/32/28/43-atsm1.jpg","width":100,"height":66},"square":{"path":"http://cdn.ticketfly.com/i/00/02/32/28/43-sq.jpg","width":100,"height":100},"squareSmall":{"path":"http://cdn.ticketfly.com/i/00/02/32/28/43-sqsm.jpg","width":60,"height":60},"xlarge":{"path":"http://cdn.ticketfly.com/i/00/02/32/28/43-atxl.jpg","width":500,"height":332},"xlarge1":{"path":"http://cdn.ticketfly.com/i/00/02/32/28/43-atxl1.jpg","width":500,"height":332},"xxlarge":{"path":"http://cdn.ticketfly.com/i/00/02/32/28/43-atxxl.jpg","width":650,"height":432},"xxlarge1":{"path":"http://